                          </div>
                        </fieldset>
                        <div className="">
                          <input className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" type="submit" value="Sign in" onClick={()=>router('home')}/>
                        </div>
                        <div className="lh-copy mt3">
                          <div className="f5 link dim black db grow pointer" onClick={()=>router('signup')}>Register Here</div>
                        </div>
                      </form>
              </main>
            </article>);
          };}

export default SignIn;
